ce more affordable, easier to access and more of a delightful experience.\r\n\r\nHeadquartered in Lagos, Nigeria, the company pioneered monthly payments for health insurance products and is at the forefront of creating more pocket-friendly and innovative health products for consumers across Nigeria.\r\n','18, Jimoh Oladehinde Street, Gbagada, Lagos','Nigeria','Lagos','','Temitope Deyeye','08109314914','temitope@reliancehmo.com','882502306_logo.png','Active',19,'2018-05-22 15:28:53','2018-05-28 16:52:11'),('Wema Bank Plc','Financial Services','Established in 1945, we are Nigerias longest surviving indigenous bank.\r\n\r\nWema Bank offers a range of retail and SME banking, corporate banking, treasury, trade services and financial advisory to its ever-expanding clients. \r\n\r\nIn 2009, the Bank underwent a strategic repositioning exercise which culminated in a decision to operate as a commercial Bank with regional authorisation in South-South Nigeria, South-West Nigeria, Lagos and Abuja in 2011. \r\nHowever, in 2015, the bank was granted a national banking licence by the Central Bank of Nigeria.\r\n\r\nWema Bank offers a range of retail and SME banking, corporate banking, treasury, trade services and financial advisory services to its numerous customers. The Bank operates a network of over 140 branches and service stations across Nigeria, backed by a robust ICT platform\r\n','54 Marina','Nigeria','Lagos','Lagos','Jubril Ajifolawe','2348054017568','Jubril.Ajifolawe@wemabank.com','418302156_logo.png','Active',20,'2018-06-05 09:53:49','2018-06-08 10:20:27'),('Veda Technology','','VEDA is committed to producing state of the art computer hardware, through innovation and modern technology in production engineering and will provide excellent after sales services to its clientele anywhere in the world.','194, Herbert Macualay Way','Nigeria','Lagos','Yaba','Ayodeji oluyede','08068856400','ayodeji@vedatechnology.com',NULL,'Active',21,'2018-06-08 11:20:08','2018-06-22 09:15:30'),('StarSight Limited',' Electrical & Electronic Manufacturing','With our team of qualified engineers, we will visit your business to gain a deep insight into your current and potential future energy consumption patterns. \r\n\r\nWe recognize every building and operation has its own unique characteristics which is why our proposition is to custom design a unique solution for each individual facility.\r\n\r\nOur collective experience across multiple sites and geographic locations ensures we are constantly developing our solution to reduce your energy expenditure as well as your carbon footprint.',' 9 Ondo St, Osborne Foreshore Est Ikoyi, Lagos, NG','Nigeria','Lagos','','Ganiyat Shittu','08033446251','gshittu@starsightlimited.com','242244535_logo.jpg','Active',22,'2018-06-13 11:57:25','2018-06-25 10:56:22'),('Greenelec Group',' Electrical & Electronic Manufacturing','We are a leading solar engineering company in Nigeria. \r\n\r\nGreenElec brings sustainable energy savings to a wide portfolio of commercial and industrial customers.\r\n \r\nWe assist you every step of the way, from developing robust energy efficiency strategies, to system engineering and installation of hybrid power generation systems.\r\n\r\nWith our team of dedicated energy and business professionals with years of experience and strong commitment to customer satisfaction, we will successfully plan and execute the energy program that will create real, sustained economic and operating benefits.','293 Akin Olugbade Street, VI ','Nigeria','Lagos','Lagos','Chinwe Udo-Davis','07056305964','chinwe.udo-davis@greenelecgroup.com','631771331_logo.jpg','Active',23,'2018-06-13 11:59:02','2018-06-13 14:31:01');
