a',' Where do great business ideas come from? We all have compelling business concepts that we\'ve been thinking about for years. In this course we will explore how to use observational tools and other techniques for idea generation and we will talk about how to evaluate the good ideas from the bad.','<p dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"> Where do great business ideas come from? We all have compelling business concepts that we\'ve been thinking about for years. In this course we will explore how to use observational tools and other techniques for idea generation and we will talk about how to evaluate the good ideas from the bad. The goal is to settle on a business idea that you are not only passionate about but also has real market application. At the end of this course learners will be able to: </span></p>\r\n<ul>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">build a resource inventory from which they can assess and create market opportunities; </span></li>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">pursue market opportunities consistent with personal passions and capabilities; and </span></li>\r\n<li dir=\"ltr\" style=\"line-height: 18