eline; white-space: pre-wrap;\">why certain details are vitally important, </span></li>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">which parts of your business plan can make or break your finance query with investors,</span></li>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">how to sharpen your public presentation of your company and its business.</span></li>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">some writing tricks to help you create a polished written plan without necessarily having to hire someone to write it for you. &nbsp;</span></li>\r\n</ul>\r\n<p><br style=\"background-color: transparent; color: #000000; font-family: Times New Roman; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px;\" /><u></u></p>',NULL,'Active',18,'2018-02-07 16:22:19','2018-02-07 16:22:19'),('Market research for building a business','Your marketing quest begins here! This course helps you to develop an overall successful marketing strategy. It i