 able to:</span></p>\r\n<ul>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">execute cost, competition and customer-based pricing. </span></li>\r\n<li dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">use the concepts of price elasticity and optimal price while setting prices for your products and services.</span></li>\r\n</ul>\r\n<p><br style=\"background-color: transparent; color: #000000; font-family: Times New Roman; font-size: 16px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px;\" /><u></u></p>',NULL,'Active',23,'2018-02-07 16:33:41','2018-02-07 16:33:41'),('Sourcing funding','Small business financing can be difficult to obtain, and at some point it may even seem like youve run out of options, but there are many different ways to get funding, a lot of which you may not even know.','<p dir=\"ltr\" style=\"line-height: 18.98px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Small business financing can be difficult to obtain, and at some point it may even seem like you&rsquo;ve run out of options, but ther