ce is far more likely to be a successful workforce. The happier and more professional an employee is, the better the results they will deliver for you. Of course, every employer wants to make sure that they have a workforce who will do their best, but this does not simply mean making the job easy for their employees.','<p dir=\"ltr\" style=\"line-height: 17.59px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;&nbsp;&nbsp; </span><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Employee Motivation is becoming ever more important in the workplace and everyone agrees that a motivated workforce is far more likely to be a successful workforce. The happier and more professional an employee is, the better the results they will deliver for you. Of course, every employer wants to make sure that they have a workforce who will do their best, but this does not simply mean making the job easy for their employees. In fact, part of the problem of motivation is when the job is too easy, employees become complacent. Therefore a challenge arises for all employers and management in delivering the right balance between a confident, motivated workforce and a workforce which is simply driven to attain stated goals. </span><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">&nbsp;&nbsp;&nbsp; </span><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">This Employee Motivation course is designed to teach you how to get the best out of a confident, motivated set of employees, and to show them how to motivate that group. By the end of this course you will be able to;</span></p>\r\n<ul>\r\n<li dir=\"ltr\" style=\"line-height: 17.59px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Explain motivation</span></li>\r\n<li dir=\"ltr\" style=\"line-height: 17.59px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Apply effective methods of staff motivation</span></li>\r\n<li dir=\"ltr\" style=\"line-height: 17.59px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Interpret and discuss the psychological theories behind employee motivation</span></li>\r\n<li dir=\"ltr\" style=\"line-height: 17.59px; margin-bottom: 0px; margin-top: 0px;\"><span style=\"background-color: transparent; color: #000000; font-family: Calibri; font-size: 14.66px; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Develop plans for more effective team motivation including making allowances for different personality types</span></li>\r\n<li dir=\"ltr\" s