aptitude test contains a combination of qualitative and quantitative questions designed to assess your analytical reasoning, numerical reasoning and verbal skills. &nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-family: \'Tahoma\',sans-serif; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: EN-GB; mso-fareast-language: EN-GB;\">You will have 60 minutes to answer 60 multiple choice questions. Please read each question carefully and choose your best answer.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-family: \'Tahoma\',sans-serif; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: EN-GB; mso-fareast-language: EN-GB;\">The test is structured as 3 sections. The test will auto-submit once your test time runs out for each section. However, if you complete a section within the allotted time you may conclude the section by clicking the &ldquo;Submit Test&rdquo; button and this will move you automatically to the next section. Once you run out of time or submit a particular section, you will no longer be able to edit your answers for that section.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-family: \'Tahoma\',sans-serif; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: EN-GB; mso-fareast-language: EN-GB;\">Before starting the test, please ensure you have with you a pen or pencil and some paper&nbsp;for your workings. You may also wish to have a calculator available to help you with the numerical reasoning section although it is not mandatory.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-family: \'Tahoma\',sans-serif; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: EN-GB; mso-fareast-language: EN-GB;\">Section 1 - General Ability has 20 questions and a 15 minute time limit. In this section, you will be provided with 8 symbols or shapes within a 3 x 3 grid. You should identify the correct choice for the empty slot in the grid form the 5 options by spotting the correct pattern. </span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-family: \'Tahoma\',sans-serif; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: EN-GB; mso-fareast-language: EN-GB;\">Please proceed to taking test and good luck.</span></p>','Active',1,'2018-02-05 13:05:28','2018-05-04 14:37:03'),('Verbal Reasoning','Aptitude Test','Medium',20,'<p><!-- [if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBrea