n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-size: 12.0pt; font-family: \'Tahoma\',sans-serif; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-GB; mso-fareast-language: EN-GB;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-family: \'Tahoma\',sans-serif; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: EN-GB; mso-fareast-language: EN-GB;\">The second question type asks you to read a passage of text and a statement related to that passage of text. You should indicate whether the statement is true, false or whether you can not tell based solely on the passage of text.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-size: 12.0pt; font-family: \'Tahoma\',sans-serif; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-GB; mso-fareast-language: EN-GB;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-family: \'Tahoma\',sans-serif; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: EN-GB; mso-fareast-language: EN-GB;\">The third question type asks you to read a sentence and makes statement about that sentence. You must select yes if you believe that the statement can be logically deduced from the sentence and no if you believe that the statement can not be logically deduced from the sentence</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-size: 12.0pt; font-family: \'Tahoma\',sans-serif; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-GB; mso-fareast-language: EN-GB;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-family: \'Tahoma\',sans-serif; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: EN-GB; mso-fareast-language: EN-GB;\">Click Start Test to Proceed to Test</span></p>\r\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-family: \'Tahoma\',sans-serif;\">&nbsp;</span></p>','Active',2,'2018-02-06 07:20:05','2018-03-06 12:39:02'),('Numerical Reasoning','Aptitude Test','Medium',25,'<p>&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-family: \'Tahoma\',sans-serif; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: EN-GB; mso-fareast-language: EN-GB;\">Section 3 - &nbsp;Numerical Reasoning has 20 questions and a 25 minute time limit. In this section, you will be provided with a question and 5 answer options. You should select the correct answer or what you believe to be the correct answer based on your calculations.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-size: 12.0pt; font-family: \'Tahoma\',sans-serif; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-GB; mso-fareast-language: EN-GB;\">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-family: \'Tahoma\',sans-serif; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: EN-GB; mso-fareast-language: EN-GB;\">Before starting this section, please ensure you have with you a pen or pencil and some paper for your workings. You may also wish to have a calculator available to help you although it is not mandatory.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-size: 12.0pt; font-family: \'Tahoma\',sans-serif; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-GB; mso-fareast-language: EN-GB;\">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\