he other hand ensuring campaigns run as planned and on schedule <span style=\"mso-spacerun: yes;\">&nbsp;</span></span></li>\r\n</ul>\r\n<ul>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 11.0pt; line-height: 115%;\">Coordinate entire campaign lifecycle &ndash; i.e., ensure influencers (and brands) follow through on campaign objectives regarding payment, </span><span lang=\"EN-GB\" style=\"font-size: 11.0pt; line-height: 115%; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-GB;\">content, scheduling etc.</span></li>\r\n</ul>\r\n<ul>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 11.0pt; line-height: 115%;\">Assist in identifying leading or high potential social media influencers and content creators to add to the existing stable of talent and assist in recruiting them to the platform</span></li>\r\n</ul>\r\n<ul>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 11.0pt; line-height: 115%;\">Develop relationships with brands and influencers &ndash; </span><span lang=\"EN-GB\" style=\"font-size: 11.0pt; line-height: 115%; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: EN-GB;\">provide ongoing feedback on social competitive activity, trends and roadmap future enhancements to Litecrowd&rsquo;s service</span></li>\r\n</ul>\r\n<ul>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 11.0pt; line-height: 115%;\">Assist in coordinating and designing Litecrowd influencer and brand events</span></li>\r\n</ul>\r\n<ul>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 11.0pt; line-height: 115%;\">Lead social listening initiatives and relay insights and guidance back to brands regarding trends they are monitoring within the community and social landscape. Use data and analytics to make strategic recommendations and action optimizations</span></li>\r\n</ul>','<ul style=\"margin-top: 0in;\" type=\"disc\">\r\n<li class=\"MsoNormal\" style=\"margin-top: 0in; margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph