d a major Supplier and Designer Architectural Hardwares in Nigeria. The company is best sourced for wide range of activities related to Stainless Steel Railings; Aluminum Railings; Burglary Proof; Stone Coated Roof; Office Partitions; Shower Cubicles; Furniture & Fittings.We are recruiting to fill the position below:Job Title: Procurement AssistantLocation: OyoJob Description</p><ul><li>Assists in organizing, coordinating and monitoring the assigned project procurement activities at the various stages of work, as well as takes the appropriate measures to ensure that the entire project procurement cycle is on schedule and within the budget and in accordance with requisition or contract requirements.</li><li>Assists in developing and implementing the procurement execution strategy and procedures in accordance with the company guidelines.</li><li>Assists in planning and developing of project scheduling with reference to issue dates of requisitions and purchase order placement.</li><li>Assists in monitoring the issue of material requisitions within required dates. Review requisitions for completeness and expediting all missing data and/or documents and establish early required delivery dates for equipment and materials in accordance with procedure and schedule</li><li>Assists in analyzing and evaluating purchase requisition forms, as assigned, to ensure purchases meet requirements.</li><li>Communicates with requesting unit or department personnel in person, by telephone or in writing when discrepancies appear on unit/departments purchase requisitions and modifies forms accordingly to ensure adherence with companys procurement processes</li><li>Communicates with vendors to clarify, inform and resolve procurement issues.</li><li>Provides assistance to office personnel on appropriate purchasing procedures.</li><li>Assist and ensure the update of vendor database files in the company approved system in order to establish authorized vendor status.</li><li>Assists in initiating and processing requests for quotations for departments purchases, researching, evaluating, and making appropriate selection of product or service classification from the company master vendor list.</li><li>Ensure authorized signatory approvals are followed, and purchase order/change orders are prepared and issued with applicable attachments.</li><li>Maintains good relationships with vendors to provide the maximum utilization of their expertise, ideas, methods and material application in order to achieve maximum cost savings.</li><li>Maintains the highest ethical and professional standards and ensures that all departmental guidelines are followed.</li><li>Coordinates with the logistics personnel to assure the timely and cost effective transport of all equipment and materials to the required site.</li><li>Maintain and file necessary vendor correspondence and purchasing documentation for information and auditing purposes in accordance with departmental file management system.</li><li>Review, proofread, and verify forms, invoices, requisitions and financial documents as necessary for accuracy in calculation and adherence to policies and procedures.</li><li>Perform other duties as assigned.</li></ul>','<ul><li>A good university First degree is required.</li><li>At least one (1) years of related experience in a purchasing position</li><li>Purchasing-related certifications i.e. Certified Purchasing Manager (CPM) will be an added advantage</li></ul>','Bachelor\'s Degree/HND','Entry','Fulltime',NULL,NULL,'Oyo, South West',NULL,0,47,NULL,50,50,NULL,0,0,'',NULL,0,NULL,'2018-05-14',16,'Kranite Nigeria Limited','https://ngcareers.com/job/2018-04/procurement-assistant-at-kranite-nigeria-limited-12','gq','tUysw6NHD5',1,1,'Active',381,'2018-04-30 01:59:19','2018-06-26 11:44:02'),('Sales Executive (Security)','<p>Proten International - Our Client, a reputable company into Security Consultants, Securities and offering Patrol Van Service, Security Guard Outsourcing.</p><ul><li>We ar