 year relevant experience.</li><li>You must be performance driven with a proven track record.</li><li>Ability to work in a fast-paced environment.</li></ul>','Diploma/OND/NCE','Entry','Fulltime',NULL,NULL,'Lagos, South West',NULL,0,27,NULL,50,50,NULL,0,0,'',NULL,0,NULL,'2018-05-06',16,'Appzone Limited','https://ngcareers.com/job/2018-04/front-desk-personnel-at-appzone-limited-959','gq','O8hpVg_pt2',1,1,'Active',454,'2018-05-03 10:02:23','2018-06-26 11:44:03'),('Sales Internship - Central Division','<p>Guinness Nigeria Plc is a major market for Diageo: Guinness Nigeria operates in the unique and fast growing alcohol industry of over 15mhl beer potential. It is the only company that does Total Beverage Alcohol (TBA) in Nigeria. Its an on trade dominated market but with a fast growing off trade channel.</p><ul><li>Diageos vision is to become the best performing most trusted and respected Consumer Goods company in every market we operate. Our goal is to be winning at the moment of choice. This along with putting the consumer at the heart of everything we do, will deliver sustained, mutual growth for our brands, categories, customers and partners</li><li>A key contributor to the success of the GNPLC strategic plan is an effective & efficient field sales team developed to demonstrating industry leadership in both volume driving & brand building.</li></ul>','<ul><li>Graduate, not more than 1 year post NYSC</li><li>High level awareness of the application of Health & Safety Standards</li><li>Good communication skills - written and verbal</li><li>Good IT skills</li><li>High degree of integrity</li><li>Good interpersonal skills</li><li>Geographically mobile.</li><li>Healthy and physically fit.</li><li>Experienced driver with valid license</li></ul>','Bachelor\'s Degree/HND','Entry','Intern',NULL,NULL,', ',NULL,0,20,NULL,50,50,NULL,0,0,'',NULL,0,NULL,'2018-05-08',16,'Guinness Nigeria Plc','https://ngcareers.com/job/2018-04/sales-internship-central-division-at-guinness-nigeria-p