agues with administrative tasks.</li><li>Answering, forwarding, and screening phone calls.</li><li>Provide excellent customer service.</li><li>Scheduling appointments.</li></ul>','<ul><li>Bachelor\'s Degree</li><li>Years of Experience; minimum of 2-3 years</li><li>Reside within Lagos with daily commute to Bank Anthony Ikeja.</li></ul>','Bachelor\'s Degree/HND','Entry','Fulltime',NULL,NULL,'Lagos, South West',NULL,0,21,NULL,50,50,NULL,0,0,'',NULL,0,NULL,'2018-05-09',16,'Torilo Nigeria','https://ngcareers.com/job/2018-04/receptionist-at-torilo-nigeria-992','gq','1HgmYuq8uZ',1,1,'Active',460,'2018-05-03 10:02:23','2018-06-26 11:44:03'),('Sales Marketing Executive','<ul><li>Develop a personal network of clients using a variety of sales and marketing tools including referrals, focus on individuals, and special interest groups, and the 3-foot rule</li><li>Helping clients to match their needs and financial situations with our custom financial and insurance products</li><li>Sales/marketing of the different insurance product & services.</li><li>Achieve steady growth in personal income through maintaining excellent after-sales service and relationships with clients.</li></ul>','<ul><li>Minimum of first Degree in any discipline.</li><li>Strong emotional intelligence and relationship management skills</li><li>Proficient in English communication, analytical, and able to work independently.</li><li>Should be a self-starter, ambitious and eager to improve own financial status</li><li>Prior sales experience desirable, but not necessary, as world-class sales and business development skills training will be provided to each successful candidate.</li><li>Candidates should not be less than 23 years of age.</li></ul>','Degree','Entry','Full-Time',NULL,NULL,'Lagos',NULL,0,38,NULL,50,50,NULL,0,0,'40,000.00 &dash; 100,000.00 per month',NULL,0,NULL,'2018-05-25',16,'F2A RESOURCES LIMITED ','https://www.jobberman.com/job/548643/sales-marketing-executive-f2a-resources-limited-in/','gq','tOy0PQ