Normal\" style=\"line-height: normal; margin: 0in 0in .0001pt .25in;\">Update digital media with timely content.</li>\r\n<li class=\"MsoNormal\" style=\"line-height: normal; margin: 0in 0in .0001pt .25in;\">Research competitors and keep abreast of market trends.</li>\r\n<li class=\"MsoNormal\" style=\"line-height: normal; margin: 0in 0in .0001pt .25in;\">Work with and manage external partners (designers, illustrators, printers, photographers, etc.) as needed to achieve digital marketing goals.</li>\r\n<li class=\"MsoNormal\" style=\"line-height: normal; margin: 0in 0in .0001pt .25in;\">Meet professional obligations through efficient work habits such as meeting deadlines, honoring schedules, coordinating resources and meetings in an effective and timely manner, and demonstrate respect for others.</li>\r\n</ul>','<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Bachelor&rsquo;s Degree in Marketing, Advertising, Communications, or Public Relations; or equivalent combination of education and relevant experience</span></p>\r\n<p><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"><span style=\"font-size: 11pt; line-height: 107%;\">Three years&rsquo; in marketing, advertising, communications, public relations, or other related fields</span></span></p>','Associate','Full time',20,'Nigeria','Lagos','<p>Excellent verbal and written communication skill</p>\r\n<p>Ability to be self motivated</p>\r\n<p>Ability to excel in a detailed-oriented environment</p>\r\n<p>Ability to be&nbsp; a strong team player and work with mulitple employees to achieve deadlines</p>',0,0,NULL,50,50,'NGN',150000,200000,'',1,1,'2018-05-04 08:08:59','2018-05-31',6,'','','gq','',1,1,'Deleted',492,'2018-05-04 08:08:59','2018-05-04 08:10:20'),('Head of Technical Operations','<p class=\"MsoNormal\" style=\"margin-left: 0in; text-indent: 0in; line-height: 115%;\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-weight: normal;\">The Head of Technical Operations will be responsible for a</span><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-weight: normal;\">ll company technical matters; maintenance (planned, preventive, scheduled, corrective and emergency), incidents and commissioning matters at all the company&rsquo;s power plants, both new and existing, including in the design and planning stage <span style=\"mso-spacerun: yes;\">&nbsp;</span></span></p>','<ul>\r\n<li class=\"MsoNormal\" style=\"margin-left: -.75pt; text-indent: 0in;\"><span style=\"font-size: 10pt; text-indent: 0in;\">Design, develop and oversee the technical specifications and all drawings for use by vendors and contractors in procurement and construction of all related plant equipment, switch gear, all panels, transformers, all related electrical apparatus etc., ensuring that all contractors and</span><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-weight: normal;\">vendors comply with all technical specifications, drawings and amendments.</span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: -.75pt; text-indent: 0in;\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-weight: normal;\">Ensure that all power plants and equipment are performing optimally in the most efficient and economical way, while maintaining a sound standard of safe running and environmental conditions for operators, other occupants and employees within the work place. </span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: -.75pt; text-indent: 0in;\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-weight: normal;\"><span style=\"mso-tab-count: 1;\">&nbsp;</span>Ensure that all Viathan&rsquo;s Standard Operating Procedures (SOP) are adhered to and reviewed on a quarterly basis.</span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: -.75pt; text-indent: 0in;\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-weight: normal;\">Ensure that all plant managers and all O&amp;M staff are fully conversant and comply with all the companies O&amp;M procedures, HSE at work practices, the National and International rules and regulations for Electricity at Work.</span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: -.75pt; text-indent: 0in;\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-weight: normal;\"><span style=\"mso-tab-count: 1;\">&nbsp;</span>Mentor engineers, plant managers, plant operators/technicians.</span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: -.75pt; text-indent: 0in;\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-weight: normal;\">Design, develop and implement a planned maintenance system across all the plants.</span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: -.75pt; text-indent: 0in;\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-weight: normal;\">Keep all O&amp;M staff abreast of latest industry developments and best practices. </span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: -.75pt; text-indent: 0in;\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-weight: normal;\">Facilitate the training and development of O&amp;M staff in conjunction with HR .</span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: -.75pt; text-indent: 0in;\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-weight: normal;\">Consult with technical team on changes in shift patterns, leave and leave coverage, manning and recruitment requirements. </span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: -.75pt; text-indent: 0in;\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-weight: normal;\">Oversee third party O&amp;M service providers on all company plants on all plant operations, including preventive and corrective maintenance, incidence management.</span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: -.75pt; text-indent: 0in;\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-weight: normal;\">Oversee the project teams, vendors and contractors in relation to all project management matters of new and existing power plants.</span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: -.75pt; text-indent: 0in;\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-weight: normal;\"><span style=\"mso-spacerun: yes;\">T</span></span><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-weight: normal;\">ake part in, conduct and present proposed feasibility studies on existing, or new power plant projects, to the senior management and the board of directors. </span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: -.75pt; text-indent: 0in;\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-weight: normal;\">To compile and keep in current view, all associated data, reports, repairs, maintenance </span><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-weight: normal;\">requisitions etc., to maintain a log/register of all data, reports, repairs and requisitions for all the power plants. </span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: -.75pt; text-indent: 0in;\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-weight: normal;\"><span style=\"mso-tab-count: 1;\">&nbsp;</span>Participate in the recruitment process &ndash; testing, interviews and selection of all technical and engineering applicants/candidates in conjunction with HR .</span></li>\r\n<li class=\"MsoNormal\" style=\"margin-left: -.75pt; text-indent: 0in;\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-weight: normal;\">Any other duties as may be assigned by the CEO.</span></li>\r\n</ul>','<p class=\"MsoNormal\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-weight: normal;\">Tertiary degree in Electrical or Mechanical or Engineering or any other related field</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 10pt;\">Minimum of 10 years&rsquo; experience in a technical management role in a Power Company or similarly related field</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-weight: normal;\">Hand-on experience in maintenance of large engines, preferably gas fired engines</span></p>','Manager','Full time',10,'Nigeria','Lagos','<p>&nbsp;</p>\r\n<p class=\"MsoNormal\"><strong><span style=\"text-decoration: underline;\"><span style=\"font-size: 10pt;\">Candidates must be knowledgeable in:</span></span></strong></p>\r\n<ul>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">In-depth knowledge and implementation of operation and maintenance of large gas and HFO engine based power plants</span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">Power protection and evacuation systems</span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-weight: normal;\">Understanding of statutory requirements for boilers, lifting tackles, pressure vessels</span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">Understanding of ancillary equipment (water treatment plants, etc)</span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">&nbsp;</span><span style=\"font-size: 10pt;\">Emergency response &ndash; first aid, fire fighting</span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-weight: normal;\">Equipment and personal safety </span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-weight: normal;\">Quality, Health, Safety and Environmental awareness </span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-weight: normal;\">Experience in general management, project management and/or budgetary oversight </span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-weight: normal;\">Experience working with external partners </span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; font-weight: normal;\">Knowledge of business development and strategic planning</span></li>\r\n</ul>\r\n<p><span style=\"text-decoration: underline;\"><strong>Skills and Competencies required includes:</strong></span></p>\r\n<ul>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">Operation planning </span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">Maintenance planning </span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">Manpower planning </span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">Project Management </span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">Budgeting </span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">Materials management/inventory management </span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">Operations data analysis and corrective action capability </span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">System alarms and interpretation&nbsp; </span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">Condition monitoring of auxiliary </span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">Negotiation </span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">Excellent communication - written and verbal </span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">Effective team management and supervision </span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">Plan, lead and manage change </span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">Attention to detail </span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">Must be willing to travel at short notice </span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">Effective management of resources and time </span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">Self-motivated and target oriented. </span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">Highly reliable, organized and dedicated </span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">Proficient in the use of a computer and basic applications. </span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">Proficient in MS Office applications&nbsp;&nbsp;</span></li>\r\n</ul>\r\n<p>&nbsp;</p>',0,45,NULL,50,50,'NGN',15000000,25000000,'',20,1,'2018-05-04 09:07:49','2018-05-31',6,'','','gq','',1,1,'Active',493,'2018-05-04 09:07:49','2018-06-26 22:06:02'),('Lounge Manager','<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 115%; background: white;\"><span lang=\"EN-GB\" style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747; mso-ansi-language: EN-GB;\">The Lounge Manager will be responsible for managing the Lounge and ensure that customers are served promptly &amp; courteously and in line with hygiene and safety standards; to ensure that all customers who visit the lounge or use the facilities have their expectations met and exceeded.</span></p>','<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747;\">Set objectives and targets for food and beverages in the lounge</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747;\">Ensure cash procedures are adhered to and strictly monitored, including preparation and calculation and cashing up of bills.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747; mso-ansi-language: EN-GB;\">Take responsibility for stock control, including ordering, acceptance, maintenance of stock levels and stock rotation, and return of any sub-standard items</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747; mso-ansi-language: EN-GB;\">Report and liaise regularly with General Manager and Board regarding lounge performance and ensure they are informed of any relevant information or issues</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747; mso-ansi-language: EN-GB;\">Develop and maintain professional relationships with internal and external customers&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747; mso-ansi-language: EN-GB;\">Liaise with accounts department to ensure invoices are forwarded promptly and are correct and that cash procedures are being adhered to</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747; mso-ansi-language: EN-GB;\">Liaise with human resources department with regards to recruitment needs, training analysis and delivery and employee relations&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747; mso-ansi-language: EN-GB;\">Perform a duty manager role while on shift when required, taking sole duty management responsibilities for the lounge and dealing with any issues that may arise during shift</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747; mso-ansi-language: EN-GB;\">Working shift rotas and weekends /public holidays, ensuring prompt timekeeping and attendance to ensure staffing levels are appropriate and efficient&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747; mso-ansi-language: EN-GB;\">Promote a positive perception of the Lounge always both internally &amp; externally&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747; mso-ansi-language: EN-GB;\">Ensure Standard Operating Procedures are achieved and maintained and are monitored and updated when and where necessary</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747; mso-ansi-language: EN-GB;\">Be aware of and anticipate customers needs&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747; mso-ansi-language: EN-GB;\">Implement and ensure the Company Health, Hygiene &amp; Safety Policy is met.&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747; mso-ansi-language: EN-GB;\">Comply with &amp; implement all legislative and licensing requirements.&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747; mso-ansi-language: EN-GB;\">Ensure the environment is clean and hygienic, making sure cleaning Schedules are adhered to and appropriate records kept&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&n