y incidents of complaint, accident, fire, loss or damage</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747; mso-ansi-language: EN-GB;\">Enforce regulatory laws, rules of Management &amp; in-house security policies&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747; mso-ansi-language: EN-GB;\">Check customer satisfaction regularly, ensuring all guest feedback is dealt with in a professional and efficient manner to minimise negative impressions of the lounge</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747; mso-ansi-language: EN-GB;\">Attend company meetings as requested</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 115%; background-repeat: initial; background-color: white;\"><span style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin: 0in 0in 7.5pt 0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><strong><u><span lang=\"EN-GB\" style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747; mso-ansi-language: EN-GB;\">Leadership:</span></u></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: 115%; background-repeat: initial; background-color: white;\"><span style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747; mso-ansi-language: EN-GB;\">Communicate a vision of success which the team want to be part of&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747; mso-ansi-language: EN-GB;\">To promote a positive attitude and team ethos, including &lsquo;lead by example&rsquo;, for the department, setting the pace and standards and encouraging mutual respect&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747; mso-ansi-language: EN-GB;\">Inspire &amp; motivate the team to achieve first class standard through Standard Operating Procedures and therefore achieve sales and profits&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747; mso-ansi-language: EN-GB;\">Train and develop the team to ensure food &amp; beverage service is to specification, and staff co-operate with managers to ensure customers&rsquo; expectations are exceeded by ensuring service is as smooth and as continuous as possible</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747; mso-ansi-language: EN-GB;\">Praise and recognise and/or recommend good performance for motivation&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747; mso-ansi-language: EN-GB;\">Deal with poor performance through informal reprimands and where necessary implement the Company Disciplinary procedure &ndash; in conjunction with HR</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 11.25pt; text-indent: -0.25in; line-height: 115%; background-repeat: initial; background-color: white;\"><!-- [if !supportLists]--><span style=\"font-size: 10.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol; color: #474747;\">&middot;<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-GB\" style=\"font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #474747; mso-ansi-language: EN-GB;\">Pro-active in problem solving and work on own initiative to de