 minor-latin; mso-hansi-theme-font: minor-latin;\">Must have a Project management concepts&nbsp;&ndash; from scheduling to meeting deadlines, and should be able to adhere to project management guidelines and processes.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin;\">Must have knowledge of electrical codes and should be able to use CAD on a daily basis.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin;\">Must be experienced in collecting and analyzing data</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin;\">Must possess strong leadership capabilities</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNoSpacing\"><span style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin;\">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-align: justify; text-indent: -18.0pt; mso-list: l2 level1 lfo1;\"></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 36.0pt; background: white;\"><span lang=\"EN-US\" style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; color: #181717;\">&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p></p>','Entry','Full time',10,'Nigeria','Lagos','',0,0,NULL,50,50,'NGN',120000,150000,'',1,1,'2018-06-13 14:02:17','2018-07-06',22,'','','gq','',1,1,'Deleted',505,'2018-06-13 14:02:17','2018-06-13 14:20:08'),('Graduate Electrical Design Engineer','<p>The Electrical design engineer will develop new electrical systems for various applications. They would be responsible for developing system specifications and layouts and also test the systems and make adjustments as needed. In addition would provide support throughout the sites construction processes.</p>','<ul>\r\n<li>Provide leadership for those reporting to you by clearly communicating the mission, goals and values of Starsight.</li>\r\n<li>Ensure work performed by all technicians is of good workmanship and compliant with current local codes.</li>\r\n<li>Review the performance of those reporting to you. Provide coaching,&nbsp;technical training, etc. to help your managers improve their performance.</li>\r\n<li>Maintain safe, secure, and healthy work environment by following and&nbsp;enforcing standards and procedures; complying with legal regulations.</li>\r\n<li>Perform weekly / monthly safety &amp; quality control inspections.</li>\r\n<li>Troubleshoot technical issues for his team Provide technical assistance&nbsp;for other staff as necessary.</li>\r\n<li>Attentive to emails and phone calls from management and the office.</li>\r\n<li>Support the design process and permit submittal.</li>\r\n<li>Assist and support the operations (technical and admin) team.</li>\r\n<li>Conduct site audits for new projects.</li>\r\n<li>Support or supervise field teams and installation progress.</li>\r\n<li>Manage site logs (Diesel levels, PV production, Gen run time etc.).</li>\r\n<li>Organize and manage all operations data and archive.</li>\r\n<li>Coordinate the work of subcontractors on and offsite.</li>\r\n<li>Pulling inventory for each installation job.</li>\r\n<li>Layout and assembly of solar modules / array and mounting hardware.</li>\r\n<li>Electrical wiring of solar hybrid system (AC and DC).</li>\r\n<li>Trouble shooting and maintenance.</li>\r\n<li>Document completion of completed installation.</li>\r\n<li>Attend mandatory training sessions on new products, installation methodology and safety.</li>\r\n<li>Coordinate and maintain spares and consumables for various systems</li>\r\n<li>Identify and implement energy and utility</li>\r\n</ul>\r\n<p>&nbsp;</p>','<ul>\r\n<li>Candidate is expected to consistently display strong communication, analytical, and problem-solving skills.</li>\r\n<li>Must be a detail-oriented time manager with the ability to meet deadlines and focus on project schedules.</li>\r\n<li>Must possess organizational, leadership, and creative skills.</li>\r\n<li>Must have a Project management concepts&nbsp;&ndash; from scheduling to meeting deadlines, and should be able to adhere to project management guidelines and processes.</li>\r\n<li>Must have knowledge of electrical codes and should be able to use CAD on a daily basis.</li>\r\n<li>Must be experienced in collecting and analyzing data.</li>\r\n<li>Must possess strong leadership capabilities</li>\r\n</ul>\r\n<p>&nbsp;</p>','Entry','Full time',10,'Nigeria','Lagos','',0,308,NULL,50,50,'NGN',120000,150000,'',1,1,'2018-06-14 15:42:55','2018-07-06',22,'','','gq','',0,0,'Active',506,'2018-06-13 14:02:38','2018-06-27 22:53:35'),('Graduate Electircal Deisgn Engineer','<p>&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; tab-stops: 45.8pt 91.6pt 137.4pt 183.2pt 229.0pt 274.8pt 320.6pt 366.4pt 412.2pt 458.0pt 503.8pt 549.6pt 595.4pt 641.2pt 687.0pt 732.8pt;\"><span lang=\"EN-US\" style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; color: #181717; background: white;\">The Electrical design engineer will develop new electrical systems for various applications. They would be responsible for developing system specifications and layouts and also test the systems and make adjustments as needed. In addition, He would provide support throughout the sites construction processes.</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','<p>&nbsp;</p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: \'Microsoft JhengHei\'; mso-hansi-theme-font: minor-latin;\">Provide leadership for those reporting to you by clearly communicating the mission, goals and values of Starsight</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Sym