y: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: \'Microsoft JhengHei\'; mso-hansi-theme-font: minor-latin;\">Support the design process and permit submittal</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: \'Microsoft JhengHei\'; mso-hansi-theme-font: minor-latin;\">Assist and support the operations (technical and admin) team</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: \'Microsoft JhengHei\'; mso-hansi-theme-font: minor-latin;\">Conduct site audits for new projects</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: \'Microsoft JhengHei\'; mso-hansi-theme-font: minor-latin;\">Support or supervise field teams and installation progress</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: \'Microsoft JhengHei\'; mso-hansi-theme-font: minor-latin;\">Manage site logs (Diesel levels, PV production, Gen run time etc.)</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: \'Microsoft JhengHei\'; mso-hansi-theme-font: minor-latin;\">Organize and manage all operations data and archive</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: \'Microsoft JhengHei\'; mso-hansi-theme-font: minor-latin;\">Coordinate the work of subcontractors on and offsite</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: \'Microsoft JhengHei\'; mso-hansi-theme-font: minor-latin;\">Pulling inventory for each installation job</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: \'Microsoft JhengHei\'; mso-hansi-theme-font: minor-latin;\">Layout and assembly of solar modules / array and mounting hardware</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: \'Microsoft JhengHei\'; mso-hansi-theme-font: minor-latin;\">Electrical wiring of solar hybrid system (AC and DC)</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: \'Microsoft JhengHei\'; mso-hansi-theme-font: minor-latin;\">Trouble shooting and maintenance</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: \'Microsoft JhengHei\'; mso-hansi-theme-font: minor-latin;\">Document completion of completed installation</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: \'Microsoft JhengHei\'; mso-hansi-theme-font: minor-latin;\">Attend mandatory training sessions on new products, installation methodology and safety</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: \'Microsoft JhengHei\'; mso-hansi-theme-font: minor-latin;\">Coordinate and maintain spares and consumables for various systems</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: \'Microsoft JhengHei\'; mso-hansi-theme-font: minor-latin;\">Identify and implement energy and utility conservation measures</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: \'Microsoft JhengHei\'; mso-hansi-theme-font: minor-latin;\">Identify quality or safety improvement opportunities</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>','<p>&nbsp;</p>\r\n<p class=\"MsoListParagraph\" style=\"text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span lang=\"EN-US\" style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span lang=\"EN-US\" style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin;\">Candidate is expected to consistently display strong communication, analytical, and problem-solving skills. </span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoListParagraph\" style=\"text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span lang=\"EN-US\" style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span lang=\"EN-US\" style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin;\">Must be a detail-oriented time manager with the ability to meet deadlines and focus on project schedules. </span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoListParagraph\" style=\"text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span lang=\"EN-US\" style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span lang=\"EN-US\" style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin;\">Must possess organizational, leadership, and creative skills.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoListParagraph\" style=\"text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span lang=\"EN-US\" style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span lang=\"EN-US\" style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin;\">Must have a Project management concepts&nbsp;&ndash; from scheduling to meeting deadlines, and should be able to adhere to project management guidelines and processes.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoListParagraph\" style=\"text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span lang=\"EN-US\" style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span lang=\"EN-US\" style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin;\">Must have knowledge of electrical codes and should be able to use CAD on a daily basis.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoListParagraph\" style=\"text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span lang=\"EN-US\" style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span lang=\"EN-US\" style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin;\">Must be experienced in collecting and analyzing data</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoListParagraph\" style=\"text-indent: -18.0pt; mso-list: l0 level1 lfo1;\"><span lang=\"EN-US\" style=\"font-size: 11.0pt; font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;\"><span style=\"mso-list: Ignore;\">&middot;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span lang=\"EN-US\" style=\"font-size: 11.0pt; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin;\">Must possess strong leadership capabilities</span></p>\r\n<p>&nbsp;</p>\r\n<p></p>','Entry','Full time',10,'Nigeria','Lagos','',0,0,NULL,50,50,'NGN',120000,150000,'',1,1,'2018-06-13 14:14:46','2018-06-11',23,'','','gq','',0,0,'Deleted',507,'2018-06-13 14:14:46','2018-06-13 16:04:41'),('Chief Operating Officer ','<p>The Chief Operating Officer will be responsible for providing strategic leadership for the organisation&rsquo;s Operational functions.</p>\r\n<p>The role will lead the implementation of the organization\'s strategic goals around service delivery and performance by driving quality, managing and executing process development initiatives</p>','<ul>\r\n<li>Oversee daily operations of the company to make adjustment when necessary to ensure effective and efficient results</li>\r\n<li>Provide in-depth knowledge and expertise on end-to-end operations &ndash; previous operations experience is very critical</li>\r\n<li>Influence and earn trust of the CEO and senior management on decision-making processes</li>\r\n<li>Provide regular clear reporting to the CEO and other relevant stakeholders on business and team performance in line with business objectives</li>\r\n<li>Promote the company&rsquo;s business by transforming business processes</li>\r\n<li>Build and retain a strong and meaningful relationship with top vendors and support all growth opportunities</li>\r\n<li>Develop operating objectives, goals and KPIs for the various departments, including administrative departments</li>\r\n<li>Routinely review processes to make sure the highest quality and most cost-effective processes are being used</li>\r\n<li>Evaluate and improve on-time-delivery, inventory levels and manpower efficiency on an ongoing basis</li>\r\n<li>Perform other duties that may be assigned by the CEO</li>\r\n</ul>','<ul>\r\n<li>Excellent communication skills</li>\r\n<li>Adaptable, resourceful and strong work ethics</li>\r\n<li>Previous experience in handling the operations of an organisation</li>\r\n<li>Excellent organisation and planning skills</li>\r\n</ul>','Senior','Full time',33,'Nigeria','Lagos','<ul>\r\n<li>Previous experience in managing the operations of an organisation</li>\r\n</ul>',0,14,NULL,50,50,'',0,0,'',1,1,'2018-06-25 16:30:09','2018-07-13',21,'','','gq','',1,1,'Active',508,'2018-06-22 09:08:14','2018-06-27 22:41:29'),('Personal Assistant','','<ul>\r\n<li>Managing diaries and organise meetings and appointments, often controlling access to the manager/executive</li>\r\n<li>Booking and arranging travel, transport and accommodation</li>\r\n<li>Support in organising events and conferences</li>\r\n<li>Reminding the CEO/executive of important tasks and deadlines</li>\r\n<li>Typing, compiling and preparing reports, presentations and correspondence</li>\r\n<li>miscellaneous tasks to support the executives, which will vary day to day</li>\r\n</ul>','<ul>\r\n<li>Excellent organisational and time management skills.</li>\r\n<li>Good written and spoken communication skills.</li>\r\n<li>Accuracy and attention to detail.</li>\r\n<li>Professional approach to solving problems.</li>\r\n<li>Excellent computer and administration skills.</li>\r\n<li>A flexible and adaptable approach to work.</li>\r\n<li>Ability to use your own initiative.</li>\r\n</ul>','Entry','Full time',15,'Nigeria','Lagos','',0,5,NULL,50,50,'',0,0,'',0,1,'2018-06-27 15:16:29','2018-06-28',21,'','','gq','',1,1,'Active',509,'2018-06-27 15:16:29','2018-06-27 22:49:24');
