  `fullname` varchar(255) COLLATE utf8_swedish_ci DEFAULT NULL,
  `email` varchar(255) COLLATE utf8_swedish_ci DEFAULT NULL,
  `gender` varchar(255) COLLATE utf8_swedish_ci DEFAULT NULL,
  `dob` date DEFAULT NULL,
  `phone` varchar(255) COLLATE utf8_swedish_ci DEFAULT NULL,
  `country` varchar(255) COLLATE utf8_swedish_ci DEFAULT NULL,
