  `city` varchar(255) COLLATE utf8_swedish_ci DEFAULT NULL,
  `address` varchar(255) COLLATE utf8_swedish_ci DEFAULT NULL,
  `introduction` longtext COLLATE utf8_swedish_ci,
  `employment_status` varchar(255) COLLATE utf8_swedish_ci DEFAULT NULL,
  `available_date` date DEFAULT NULL,
  `expected_salary` float DEFAULT NULL,
  `video_file` varchar(255) COLLATE utf8_swedish_ci DEFAULT NULL,
  `youtube_vid_id` varchar(255) COLLATE utf8_swedish_ci DEFAULT NULL,
  `photo` varchar(255) COLLATE utf8_swedish_ci DEFAULT NULL,
  `photo_status` tinyint(1) DEFAULT NULL,
  `profile_status` tinyint(1) DEFAULT NULL,
  `video_status` tinyint(1) DEFAULT NULL,
  `test_status` tinyint(1) DEFAULT NULL,
